"use strict";

Object.defineProperty(exports, "__esModule", {
    value: true
});
exports.uniqueId = uniqueId;
var idCounter = 0;

// eslint-disable-next-line import/prefer-default-export
function uniqueId(prefix) {
    // eslint-disable-line
    idCounter += 1;
    return prefix ? prefix + "-" + idCounter : String(idCounter);
}
